import (
	"github.com/pulumi/pulumi-fastly/sdk/v3/go/fastly"
	"github.com/pulumi/pulumi/sdk/v3/go/pulumi"
)

func main() {
	pulumi.Run(func(ctx *pulumi.Context) error {
		_, err := fastly.NewUserv1(ctx, "demo", &fastly.Userv1Args{
